import React from 'react';

function LandingPage() {
    return (
        <div className="landing_page">
            <HeroSlider />
        <SortByContent />
        <LandingPageCards />
        <ImgOverlay />
        <CustomerReviews />
        </div>
    )
}

export default LandingPage
